        if (!isTreeActive) return;

        const smokeStart = smokeStartRef.current;
        const svg = svgRef.current;
        if (!smokeStart || !svg) return;

        // Create a pool of reusable smoke particles
        const particlePool = Array.from({ length: 10 }, () => {
            const smoke = document.createElementNS("http://www.w3.org/2000/svg", "circle");
            smoke.classList.add('smoke-particle');
            smoke.style.display = 'none';
            svg.appendChild(smoke);
            return smoke;
        });

        let poolIndex = 0;

        const createSmoke = () => {
            // Reuse particle from pool
            const smoke = particlePool[poolIndex];
            poolIndex = (poolIndex + 1) % particlePool.length;

            // Show the particle
            smoke.style.display = '';

            // Random properties for variation
            const duration = gsap.utils.random(4, 6);
            const xTravel = gsap.utils.random(-100, 100);
            const scale = gsap.utils.random(1, 3);
            const isEven = Math.random() > 0.5;

            // Set gradient fill
            smoke.setAttribute('fill', isEven ? 'url(#smokeGradient1)' : 'url(#smokeGradient2)');

            // Get position in SVG coordinates
            const rect = smokeStart.getBoundingClientRect();
            const svgRect = svg.getBoundingClientRect();
            const point = svg.createSVGPoint();
            point.x = rect.left + rect.width/2 - svgRect.left;
            point.y = rect.top + rect.height/2 - svgRect.top;
            const svgPoint = point.matrixTransform(svg.getScreenCTM().inverse());

            // Reset position and properties
            gsap.set(smoke, {
                cx: svgPoint.x,
                cy: svgPoint.y,
                r: 12,
                opacity: 1,
                x: 0,
                y: 0,
            });

            // Use GSAP's performanceMode
            gsap.to(smoke, {
                r: 12 * scale,
                opacity: 0,
                y: -150 - (Math.random() * 100),
                x: xTravel,
                duration: duration,
                ease: "power1.out",
                force3D: true, // Force GPU acceleration
                onComplete: () => {
                    smoke.style.display = 'none'; // Hide instead of removing
                }
            });
        };

        // Reduce animation frequency slightly
        const interval = setInterval(createSmoke, 1000); // Increased from 400 to 500ms

        return () => {
            clearInterval(interval);
            // Hide particles instead of removing them
            particlePool.forEach(smoke => {
                smoke.style.display = 'none';
            });
        };
